-- ----------------------------
-- View structure for lastMonthReservationView
-- ----------------------------
DROP VIEW IF EXISTS `lastMonthReservationView`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lastMonthReservationView` AS select `b`.`uid` AS `boxId`,`t`.`number` AS `number` from (`shopBox` `b` left join (select `r`.`boxId` AS `boxId`,count(`r`.`boxId`) AS `number` from (`reservation` `r` join `orders` `o`) where ((`r`.`orderId` = `o`.`uid`) and (`o`.`orderTime` > ((unix_timestamp(now()) * 1000) - ((((1000 * 60) * 60) * 24) * 30)))) group by `r`.`boxId`) `t` on((`b`.`uid` = `t`.`boxId`)));

-- ----------------------------
-- View structure for lastMonthSalesView
-- ----------------------------
DROP VIEW IF EXISTS `lastMonthSalesView`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lastMonthSalesView` AS select `p`.`uid` AS `productId`,`s`.`sales` AS `sales` from (`product` `p` left join (select `A`.`productId` AS `productId`,sum(`A`.`number`) AS `sales` from (`orderProduct` `A` join `orders` `B`) where ((`A`.`orderId` = `B`.`uid`) and (`B`.`orderTime` > ((unix_timestamp(now()) * 1000) - ((((1000 * 60) * 60) * 24) * 30)))) group by `A`.`productId`) `s` on((`p`.`uid` = `s`.`productId`)));

-- ----------------------------
-- View structure for orderCurrentTime
-- ----------------------------
DROP VIEW IF EXISTS `orderCurrentTime`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `orderCurrentTime` AS select `orderStatus`.`orderId` AS `orderId`,max(`orderStatus`.`time`) AS `time` from `orderStatus` group by `orderStatus`.`orderId`;

-- ----------------------------
-- View structure for totalReservationView
-- ----------------------------
DROP VIEW IF EXISTS `totalReservationView`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `totalReservationView` AS select `b`.`uid` AS `boxId`,`t`.`number` AS `number` from (`shopBox` `b` left join (select `reservation`.`boxId` AS `boxId`,count(`reservation`.`boxId`) AS `number` from `reservation` group by `reservation`.`boxId`) `t` on((`b`.`uid` = `t`.`boxId`)));

-- ----------------------------
-- View structure for totalSalesView
-- ----------------------------
DROP VIEW IF EXISTS `totalSalesView`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `totalSalesView` AS select `p`.`uid` AS `productId`,`s`.`sales` AS `sales` from (`product` `p` left join (select `orderProduct`.`productId` AS `productId`,sum(`orderProduct`.`number`) AS `sales` from `orderProduct` group by `orderProduct`.`productId`) `s` on((`p`.`uid` = `s`.`productId`)));

